import React from 'react';
import logo from './Logo.png';
import './App.css';
import './Components/EmailButton.js';
import { EmailButton } from './Components/EmailButton.js';
import { Password } from './Components/Password.js';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Home from './Pages/Home.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>

        </p>
        <EmailButton>
        </EmailButton>
        <Password>
        </Password>
        <button style=
      {{ backgroundColor: 'white', color:'#FF477E',borderRadius: '88px',border:'none',
      width:'296px',height:'50px',textAlign:'center',fontSize:'2vw',marginTop:'20px'}}>
        Login
        </button>

        <button style=
      {{ backgroundColor: 'white', color:'#FF477E',borderRadius: '88px',border:'none',
      width:'296px',height:'50px',textAlign:'center',fontSize:'2vw',marginTop:'30px'}}>
        Sign Up
        </button>
      </header>
      <BrowserRouter>
      <Routes>
        <Route path="/Home" component={<Home/>} />
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
